import { createApp } from "vue";
import App from "./components/MainWindow.vue";
import AppTow from "./components/EnrollWindow.vue";
import Antd from "../node_modules/ant-design-vue";
import "../node_modules/ant-design-vue/dist/reset.css";
import router from "../router"; // 引入路由配置

// 使用createApp创建Vue应用实例
const app = createApp(App);
const appTow = createApp(App);

// 使用app.use安装Ant Design Vue插件
app.use(Antd);
app.use(router);

appTow.use(Antd);

// 挂载应用实例
app.mount("#app");
appTow.mount("#app");
